import { useParams } from 'react-router-dom';

function CalculatorPage() {
  const { type } = useParams();

  return (
    <div>
      <h2>Калькулятор: {type}</h2>
      <p>Форма для расчета будет здесь.</p>
    </div>
  );
}

export default CalculatorPage;
